import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
const CalculatorIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <rect x="4" y="4" width="16" height="16" rx="2" ry="2"></rect>
    <line x1="8" y1="12" x2="16" y2="12"></line>
    <line x1="12" y1="8" x2="12" y2="16"></line>
  </svg>
);

const GlobeIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <circle cx="12" cy="12" r="10"></circle>
    <line x1="2" y1="12" x2="22" y2="12"></line>
    <path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"></path>
  </svg>
);

const LeafIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <path d="M11 20A7 7 0 0 1 4 13V7a7 7 0 0 1 7-7c2 0 4.5 1 6 5 1.5-4 4-5 6-5a7 7 0 0 1 7 7v6a7 7 0 0 1-7 7Z"></path>
  </svg>
);

const InfoIcon = () => (
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <circle cx="12" cy="12" r="10"></circle>
    <line x1="12" y1="16" x2="12" y2="12"></line>
    <line x1="12" y1="8" x2="12.01" y2="8"></line>
  </svg>
);

const Navbar = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <nav 
      className={`
        fixed top-0 left-0 w-full z-50 transition-all duration-300 
        ${isScrolled 
          ? 'bg-white/90 shadow-md backdrop-blur-md' 
          : 'bg-transparent'
        }
      `}
    >
      <div className="max-w-6xl mx-auto px-4 py-3 flex justify-between items-center">
        {/* Logo Section */}
        <div className="flex items-center space-x-3">
          <span 
            className={`
              text-green-600 transition-transform duration-300
              ${isScrolled ? 'rotate-6 scale-110' : 'rotate-0'}
            `}
          >
            ðŸŒ±
          </span>
          <span className={`
            font-bold text-xl transition-colors duration-300
            ${isScrolled ? 'text-gray-800' : 'text-white'}
          `}>
            CarbonCalc
          </span>
        </div>

        {/* Navigation Links */}
        <ul className="flex space-x-6">
          {[
            { to: "/home", icon: CalculatorIcon, text: "Calculator" },
            { to: "/why-carbon", icon: GlobeIcon, text: "Why Carbon?" },
            { to: "/projects", icon: LeafIcon, text: "Projects" },
            { to: "/about", icon: InfoIcon, text: "About Us" }
          ].map(({ to, icon: Icon, text }) => (
            <li key={to}>
              <Link 
                to={to} 
                className={`
                  flex items-center space-x-2 
                  group transition-all duration-300
                  ${isScrolled 
                    ? 'text-gray-700 hover:text-green-600' 
                    : 'text-white hover:text-green-200'
                  }
                  hover:scale-105
                `}
              >
                <Icon />
                <span className="font-medium">{text}</span>
              </Link>
            </li>
          ))}
        </ul>

        {/* Action Buttons */}
        <div className="flex space-x-4">
          {[
            { to: "/login", text: "Login", variant: "outline" },
            { to: "/signup", text: "Sign Up", variant: "primary" }
          ].map(({ to, text, variant }) => (
            <Link
              key={to}
              to={to}
              className={`
                flex items-center space-x-2 px-4 py-2 rounded-full 
                font-semibold transition-all duration-300 
                ${variant === 'primary' 
                  ? 'bg-green-600 text-white hover:bg-green-700' 
                  : 'border border-green-600 text-green-600 hover:bg-green-50'
                }
                hover:shadow-md transform hover:-translate-y-1
              `}
            >
              <span>{text}</span>
            </Link>
          ))}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
